import React from 'react';
import Logo from './images/logo.png';

const Header = () => {
    return (
        <div style={{display:"flex", alignItems:"center"}}>
            <img src={Logo}  alt="pizzalogo" height="40px" />
            <div style={{color:'white'}}>Pizza Customization</div>
        </div>
    )
};

export default Header;
